# -----------------------
# Helpers (safe border edits)
# -----------------------
def _set_border(cell, *, left=None, right=None, top=None, bottom=None):
    """Safely update border sides without wiping other sides."""
    b = cell.border if cell.border else Border()
    
    # None   border , Side(style=None)   border 
    def get_side(value, existing):
        if value is None:
            return existing
        elif isinstance(value, Side) and value.style is None:
            return Side(style=None)  #   border
        else:
            return value
    
    cell.border = Border(
        left=get_side(left, b.left),
        right=get_side(right, b.right),
        top=get_side(top, b.top),
        bottom=get_side(bottom, b.bottom),
        diagonal=b.diagonal,
        diagonal_direction=b.diagonal_direction,
        outline=b.outline,
        vertical=b.vertical,
        horizontal=b.horizontal,
    )


def _hline(ws, row, c1, c2, side, *, where="bottom"):
    for c in range(c1, c2 + 1):
        cell = ws.cell(row=row, column=c)
        if where == "bottom":
            _set_border(cell, bottom=side)
        else:
            _set_border(cell, top=side)


def _vline(ws, col, r1, r2, side, *, where="right"):
    for r in range(r1, r2 + 1):
        cell = ws.cell(row=r, column=col)
        if where == "right":
            _set_border(cell, right=side)
        else:
            _set_border(cell, left=side)


def _outline(ws, r1, c1, r2, c2, side):
    """Optimized: Uses apply_border_outline_fast for edge-only processing"""
    apply_border_outline_fast(ws, r1, c1, r2, c2, side)


def _fill(ws, r1, c1, r2, c2, fill):
    for r in range(r1, r2 + 1):
        for c in range(c1, c2 + 1):
            ws.cell(r, c).fill = fill


def _center_across(ws, row, c1, c2, text, *, font=None, fill=None):
    """
    Excel 'Center Across Selection' effect without merges.
    We apply centerContinuous to all cells in the span and keep only the first cell non-empty.
    Optimized: Uses cached alignment.
    """
    align_center_continuous = get_alignment(horizontal="centerContinuous", vertical="center")
    for c in range(c1, c2 + 1):
        cell = ws.cell(row=row, column=c)
        cell.alignment = align_center_continuous
        if fill is not None:
            cell.fill = fill
        if font is not None:
            cell.font = font
        if c == c1:
            cell.value = text
        else:
            cell.value = None


def _add_logo(ws, anchor_cell="B2", *, width_px=220, height_px=52):
    raw = base64.b64decode(_LOGO_PNG_B64)
    bio = BytesIO(raw)
    img = XLImage(bio)
    img.width = width_px
    img.height = height_px
    ws.add_image(img, anchor_cell)


